import React from "react";
import { makeStyles, Grid, Paper } from "@material-ui/core";

const useStyles = makeStyles(theme => ({
  background: {
    flexGrow: 1,
    background: "grey",
    height: "660px",
    textAlign: "center"
  },
  text: {
    color: "white",
    padding: "0 auto",
    margin: "0"
  }
}));

const BodyOrderChoiceList = () => {
  const classes = useStyles();

  return (
    <div className={classes.background}>
      <Grid container>
        <Grid item xs={12} style={{ color: "grey", height: 100 }}>
          {/* <Paper className={classes.paper} style={{ color: "" }}>
            xs=12
          </Paper> */}
        </Grid>
      </Grid>
    </div>
  );
};

export default BodyOrderChoiceList;
